/h3>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"0528eab3-ad5b-4ef9-be6f-f7dd67dbb521\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":3.993610223642172,\"y\":60.480477953550995,\"width\":66.5601703940362,\"height\":34.184617973746214,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>We can insert the dividend (413) between two multiples of the divisor (8).</p>\\n\\n<p>\\\\( 400 &lt; 413 &lt; 480 \\\\)</p>\\n\\n<p>\\\\(8\\\\times 50 &lt;  413 &lt;  8\\\\times 60\\\\) </p>\\n\\n<p>Hence, the <span style=\\\"color:#0086ff\\\"><strong>quotient</strong></span> of 413 by 8 is between <strong>50 </strong>and <strong>60</strong>. </p>\\n\\n<p> </p>\\n\"},\"subContentId\":\"0818f4ab-dabc-4332-ab60-78eac3d684c7\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}]},{\"slideBackgroundSelector\":{},\"elements\":[{\"x\":0,\"y\":18.407101985863346,\"width\":23.961661341853034,\"height\":78.71981235274319,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"decorative\":true,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAQEAeAB4AAD/2wBDAAMCAgMCAgMDAwMEAwMEBQgFBQQEBQoHBwYIDAoMDAsKCwsNDhIQDQ4RDgsLEBYQERMUFRUVDA8XGBYUGBIUFRT/2wBDAQMEBAUEBQkFBQkUDQsNFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBQUFBT/wAARCAJaAWoDASIAAhEBAxEB/8QAHwAAAQUBAQEBAQEAAAAAAAAAAAECAwQFBgcICQoL/8QAtRAAAgEDAwIEAwUFBAQAAAF9AQIDAAQRBRIhMUEGE1FhByJxFDKBkaEII0KxwRVS0fAkM2JyggkKFhcYGRolJicoKSo0NTY3ODk6Q0RFRkdISUpTVFVWV1hZWmNkZWZnaGlqc3R1dnd4eXqDhIWGh4iJipKTlJWWl5iZmq
